import React, { Component } from "react";

import image from "../images/plus-circle.svg";

class MenuButton extends React.Component {
  render() {
    return (
      <div>
        <img
          className="menuComponent"
          src={image}
          onClick={this.handleClick}></img>
      </div>
    );
  }
}

export default MenuButton;
